import React from "react";

class ComingSoon extends React.Component {
    render() {
        return (
            <div className="row coming-soon">
                <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <h1>Coming Soon</h1>
                </div>
            </div>
        )
    }
}

export default ComingSoon
